title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o4615.m0 -> o4605.m5 -> o4615.m7 -> o4605.m5
  o4605.m5 -> o4615.m7 -> o4605.m5
  o4615.m3 -> o4605.m5 -> o4615.m7 -> o4605.m5
  o4605.m4 -> o4615.m7 -> o4605.m5 -> o4615.m7
  o4615.m7 -> o4605.m5 -> o4615.m7

features:
  - inheritance
  - overriding
  - method
  - polymorphism

